import { Card, Container, Grid } from "@mui/material";
import AddTask from "./components/AddTask";
import CustomCard from "./components/CustomCard";
import Header from "./components/Header";

function App() {
  const noteData = [
    {
      id: 0,
      title: " Note 1",
      note: "Heloo this ish djdskjajs",
    },
    {
      id: 1,
      title: " Note 1",
      note: "Heloo this ish djdskjajs",
    },
    {
      id: 2,
      title: " Note 1",
      note: "Heloo this ish djdskjajs",
    },
  ];

  return (
    <div className="App">
      <Header />
      <Container>
        {noteData.map((item) => {
          return (
            <Grid container>
              <Grid item md={4} sm={6} xs={12}>
                <CustomCard />
              </Grid>
            </Grid>
          );
        })}

        <AddTask />
      </Container>
    </div>
  );
}

export default App;
